"""
Given string S and a dictionary of words words, find the number of words[i] that is a subsequence of S.

Example :
Input:
S = "abcde"
words = ["a", "bb", "acd", "ace"]
Output: 3
Explanation: There are three words in words that are a subsequence of S: "a", "acd", "ace".

Note:

    All words in words and S will only consists of lowercase letters.
    The length of S will be in the range of [1, 50000].
    The length of words will be in the range of [1, 5000].
    The length of words[i] will be in the range of [1, 50].

"""
class Solution(object):
    def numMatchingSubseq(self, S, words):
        """
        :type S: str
        :type words: List[str]
        :rtype: int
        OVERTIME
        """
        ans = 0
        for word in words:
            start = 0
            i = 0
            # word的每个字符去查找
            while i < len(word):
                # 与S字符一个个比对
                while start < len(S):
                    # 有相同的，双方都往前进1位
                    if word[i] == S[start]:
                        start += 1
                        i += 1
                        break
                    # 否则只有S往前进一位
                    else:
                        start += 1
                # 如果S全部走完，还是不能与word匹配，则跳出
                if start >= len(S):
                    break
            # 记录所有能从S中找到的word
            if i == len(word):
                ans += 1
        return ans

    def numMatchingSubseq_1(self, S, words):
        """
        :type S: str
        :type words: List[str]
        :rtype: int
        938MS
        """
        import collections, bisect
        ans = 0
        S_dicts = collections.defaultdict(list)
        # 记录下S中每个字母出现的位置
        for i, char in enumerate(S):
            S_dicts[char].append(i)
        for word in words:
            # 一开每个从S的0位开始，用二分查找，我们就从-1开始
            start = -1
            flag = True
            # word中的每个字母去S中查找位置
            for char in word:
                # 如果该字母不再S中，则word不能由S子串组成
                if S_dicts[char] == []:
                    flag = False
                    break
                else:
                    # 在S中查找最近的位置，且要在上次选定的位置之后的
                    pos = bisect.bisect(S_dicts[char], start)
                    # 如果有，则更新当前位置
                    if pos < len(S_dicts[char]):
                        start = S_dicts[char][pos]
                    # 找不到满足条件的位置
                    else:
                        flag = False
            # 满足条件的word，ans+1
            if flag:
                ans += 1
        return ans

    def numMatchingSubseq_2(self, S, words):
        """
        :type S: str
        :type words: List[str]
        :rtype: int
        527ms
        """
        import collections
        waiting = collections.defaultdict(list)
        for w in words:
            waiting[w[0]].append(iter(w[1:]))
        for c in S:
            print('c', c)
            # Python 字典 pop() 方法删除字典给定键 key 所对应的值，返回值为被删除的值。key值必须给出。 否则，返回default值。
            # 把所有以c开头的word都删除
            for it in waiting.pop(c, ()):
                # 如果这个word还有其他字母，则与之前的合并，否则放到None中，表示该word能匹配
                waiting[next(it, None)].append(it)
        return len(waiting[None])



